};
struct cloth_sim_collision_primitive_info {
int    bone_index;
short    is_capsule;
short    do_scale;
float    radius;
float    height;
xxx_vector_conv pos;
xxx_vector_conv axis;
xxx_vector_conv local_space_pos;
